import './App.css';
import Navbar from './Componenets/Navbar';
import { BrowserRouter,Route,link } from 'react-router-dom';
import Homescreen from './screens/Homescreen';
function App() {
  return (
    <div className="App">
      <Navbar/>
      <BrowserRouter>
      <Route path="/home" exact Component={Homescreen}/>
      </BrowserRouter>
    </div>
  );
}

export default App;
